import React from 'react';

const Intro = () => {
    return (
        <>
        Lee Forbes
        <br/>
        About me: I recently graduated from The University of Texas at Austin with a BS in Computer Science. I like to participate in various hobbies in my free time such as skateboarding, ultimate frisbee, Spikeball, and video games.I have had the honor to work at Omni Flow Computers, Blackbaud, iD Tech, Vans, Cane's, and [your company can be here too].
        </>
    )
}
